import React from 'react'

const Result = (props: any) => {
    const thisSelectedValue = props.selection[props.index];
    console.log("This selection: " + thisSelectedValue);
    const isNotEmpty: boolean = true;
    const isCorrect: boolean = true; 

    if (props.isNotEmpty) {
        return <div className={props.isCorrect ? "result-container correct" :  "result-container false"}>
            <i className="material-symbols-outlined">{props.isCorrect ? "check": "toys_and_games"}</i>
            <p>{props.isCorrect ? "Correct" : "Try again!"}</p>
        </div>
    }
}

export default Result;
